import React from 'react'
import Typewriter from "typewriter-effect";


const Typewriter3 = ({words}) => {
    return (
        <div id='typewriter'>
            <h3><Typewriter
            options={{
                strings: words,
                autoStart: true,
                loop: true,
                pauseFor: 2000,
            }}></Typewriter>
           
            </h3>
        </div>
    )
}

export default Typewriter3
